import React from 'react';
import './home.css'; // Custom CSS for styling the home page
import { ButtonGroup, Button } from 'react-bootstrap';

function Home() {
  const handleArrivals = () => {
    // You can add logic here to handle arrival button click, such as API calls or redirection
    console.log('Arrivals Clicked');
  };

  const handleDepartures = () => {
    // You can add logic here to handle departure button click
    console.log('Departures Clicked');
  };

  

  return (
    <div id="header">
    <div className="home-container">
      <div className="overlay">
        <h1>Welcome to Airport Directory App</h1>
        <div className="button-group">
          <ButtonGroup>
          <Button variant="primary" onClick={handleArrivals}>ARRIVALS</Button>
          <Button variant="primary" onClick={handleDepartures}>DEPARTURES</Button>
          </ButtonGroup>
        </div>
      </div>
      <div>
      <ul id="sidemenu" className={menuOpen ? 'open' : 'closed'}>
        <li><a href="#header">Home</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#services">Services</a></li>
        <li><a href="#portfolio">Portfolio</a></li>
        <li><a href="#contact">Contact</a></li>
        <i className="fas fa-times" onClick={closeMenu} style={{ cursor: 'pointer' }}></i>
      </ul>
      <i className="fas fa-bars" onClick={openMenu} style={{ cursor: 'pointer' }}></i>
    </div>
    </div>
    </div>
  );
}

export default Home;
